        menu = (<h1>select user</h1>);
    }else{
        menu = (
        <ul>
            <li>
                <Link to='/list'>List</Link>
            </li>
            <li>
                <Link to='/new'>New</Link>
            </li>
        </ul>);
    }



    return (
        <div>

        {menu}





